measurements.description:
Nineteen flowers on one arching 76-cm inflorescence;
	sepals and petals pink, speckled dark burgundy, spotted densely at midline;
	lip cream, flushed light burgundy at margins, dark burgundy at apex, callus yellow, marked dark burgundy;
	column white, flushed and spotted pink, anther cap yellow;
	substance hard; texture matte.
